import React from "react";

const Hook = (setItemList) => {
  React.useEffect(() => {
    let fetchJsonData = fetch("https://dummyjson.com/products?limit=100");
    let readData = fetchJsonData.then((data) => data.json());
    let usedata = readData.then((data) => data);
    setItemList(usedata);
  }, []);
};

export { Hook };
